import React, { useEffect } from 'react';
import logo from "../../Assets/images/logo.jpg";
import { Link } from 'react-router-dom';

const Header = () => {
  useEffect(() => {
    const navbar = document.querySelector('.navbar');
    window.addEventListener('scroll', () => {
      if (window.scrollY > 0) {
        navbar.classList.add('sticky');
      } else {
        navbar.classList.remove('sticky');
      }
    });

    return () => {
      window.removeEventListener('scroll', () => {});
    };
  }, []);

  return (
    <div>
      <nav className="uk-navbar-container" style={{ backgroundColor: "white" }}>
        <div className=" navbar">
          <div uk-navbar>
            <div className="uk-navbar-left">
              <Link to={"/"}>
                <div style={{ width: "150px", height: "100px" }}>
                  <img src={logo} alt="Logo" />
                </div>
              </Link>
              <ul className="uk-navbar-nav" style={{ marginLeft: "48%", paddingBottom: "20px", fontWeight: "600" }}>
                <li>
                  <a href="#" className='black'>
                    <Link to={"/creator"} style={{ color: 'black' }}>
                      <span className="uk-margin-small-right black"></span>
                      Home
                    </Link>
                  </a>
                </li>
                <li>
                  <a href="#">
                    <Link to={"/contact"} style={{ color: 'black' }}>
                      <span className="uk-margin-small-right"></span>
                      About
                    </Link>
                  </a>
                </li>
              </ul>
              <div className="uk-navbar-item" style={{ paddingBottom: "28px" }}>
                <form action="javascript:void(0)">
                  <button style={{ backgroundColor: 'darkgrey', borderRadius: "20px" }} className="uk-button uk-button-primary custombtn">Contact</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </nav>
    </div>
  )
}

export default Header;
